import React from 'react';
import ReactDOM from 'react-dom';
import {add,sub,div,mult} from './Calc';





ReactDOM.render(
    <>
    <ul>
        <li> sum of 2 no is {add(20,28)} </li>
        <li> sub of 2 no is {sub(40,21)} </li>
        <li> div of 2 no is {div(100,10)} </li>
        <li> mult of 2 no is {mult(90,78)} </li>
    </ul>
    </>,

    document.getElementById("root")
);
